import React from 'react';
import './css/tourist.css'

interface tourType {
    name: string;
    location: string;
    email: string;
    profpic: string;
}

export function TouristDet(props:tourType){
    return <div className="">
        <div>
            <img className="prof-pic" src={props.profpic}/>
        </div>
        {props.name}
        {props.location}
        {props.email}
    </div>
};
